                          boxSizing: " border-box",
                          position: "absolute",
                          width: "40%",
                          height: 175,
                          left: 290,
                          top: 44,
                          borderRadius: 10,
                          padding: 22,
                          background: "transparent",
                        }}
                      >
                        <img
                          src={Promptpay}
                          alt="Promptpay"
                          style={{ width: "100%", height: "auto", margin: 10 }}
                        />
                        <p
                          style={{
                            fontWeight: 500,
                            color: "#333333",
                            fontSize: 23,
                          }}
                        >
                          {PaymentEN[5].label}
                        </p>
                      </div>
                    </Box>
                  </Modal>
                </>
              )}
            </>
          </Box>
          {/* Drawer status */}
          {openChat === "" ? (
            <></>
          ) : (
            <Drawer
              variant="permanent"
              anchor="right"
              sx={{
                width: 300,
                [`& .MuiDrawer-paper`]: {
                  width: 300,
                  boxSizing: "border-box",
                },
              }}
              style={{ zIndex: 0, height: "100%" }}
            >
              <Toolbar />
              <Box sx={{ overflow: "hidden" }}>
                <div style={{ marginTop: 50, textAlign: "center" }}>
                  <div>
                    <FaUserCircle
                      alt="avatar"
                      style={{
                        width: " 20%",
                        height: "auto",
                        margin: "auto",
                        display: "block",
                        color: "#3333",
                      }}
                    />
                  </div>
                  <div>
                    <p
                      style={{
                        fontWeight: 500,
                        fontSize: 20,
                        color: "#353535",
                        marginBottom: 0,
                      }}
                    >
                      {openChat?.Customer_name}
                    </p>
                    <p style={{ fontSize: 13, color: "#c4c4c4", margin: 0 }}>
                      Active 21m ago.
                    </p>
                    <button
                      style={{
                        background: "#FAFAFA",
                        boxShadow: "0px 4px 10px rgba(0, 0, 0, 0.1)",
                        borderRadius: 5,
                        width: 140,
                        height: "auto",
                        border: "none",
                        fontSize: 15,
                        color: "#FFC100",
                        padding: 5,
                        marginBottom: 10,
                      }}
                      onClick={() => Create_Quotation()}
                    >
                      <p style={{ marginBottom: 0 }}>Create Quotation.</p>
                    </button>
                  </div>
                  <hr style={{ width: "90%", height: 1, margin: 15 }} />
                  <div style={{ margin: 20 }}>
                    <Status
                      Status={openChat?.Status}
                      Price={openChat?.Price}
                      Deadline={openChat.Deadline}
                    />
                  </div>
                </div>
              </Box>
            </Drawer>
          )}
        </>
      </Box>
    </div>
  );
}
